import { Component, OnInit, OnDestroy } from '@angular/core';
import { Observable, Subscription } from 'rxjs';
import { ActivatedRoute, Router } from '@angular/router';
import { Location } from '@angular/common';
import { Olympic } from 'src/app/core/models/Olympic';
import { OlympicService } from 'src/app/core/services/olympic.service';
import { catchError} from 'rxjs/operators';
import { map } from 'rxjs/operators';
import { ChartData, ChartOptions } from 'chart.js';

@Component({
  selector: 'app-country-details',
  templateUrl: './country-details.component.html',
  styleUrl: './country-details.component.scss'
})

export class CountryDetailsComponent implements OnInit{
  public olympics$!: Observable<Olympic[]>;
  public countryId!: number;
  public countryDetails$!: Observable<Olympic | undefined>;
  public numberOfEntries!: number; // pour tous les pays
  public numberOfAthletes$!: Observable<number>;
  public numberOfMedals$!: Observable<number>;
  public numberOfEntriesForCountry$!: Observable<number>; // pour un seul pays

  // Configuration des données pour le Line Chart
  public lineChartData: ChartData<'line'> = {
    labels: [], // Années
    datasets: [
      {
        data: [], // Nombre de médailles
        label: 'Médailles',
        borderColor: '#42A5F5',
        backgroundColor: 'rgba(66,165,245,0.2)',
        fill: true,
      },
    ],
  };

  // Options du graphique
  public lineChartOptions: ChartOptions<'line'> = {
    responsive: true,
  };

  // Stocker l'abonnement
  private subscription: Subscription = new Subscription(); 

  constructor(
    private olympicService: OlympicService, 
    private route: ActivatedRoute, 
    private router: Router,
    private location: Location // Ajout de Location pour revenir à la page précédente pas forcément à home
  ) {}

  ngOnInit(): void {
    this.olympicService.getNumberOfParticipations().subscribe((numberOfEntries: number) => {
      this.numberOfEntries = numberOfEntries;
      console.log(`Nb de participations : ${numberOfEntries}`);
    });

    // Récupère l'id via la route et le transforme en number
    this.countryId = Number(this.route.snapshot.params['id']);

    // Charger les détails du pays
    this.countryDetails$! = this.olympicService.getOlympicById(this.countryId).pipe(
      catchError(() => {
        this.router.navigate(['/404']); // Redirection en cas d'erreur
        return [];
      })
    );

    // Calculer le nombre total d'athlètes par pays
    this.numberOfAthletes$ = this.countryDetails$.pipe(
      map(country => country ? country.participations.reduce((sum, participation) => sum + participation.athleteCount, 0) : 0)
    );

    // Calculer le nombre total de medailles par pays
    this.numberOfMedals$ = this.countryDetails$.pipe(
      map(country => country ? country.participations.reduce((sum, participation) => sum + participation.medalsCount, 0) : 0)
    );

    // Calculer le nombre total de medailles par pays
    this.numberOfEntriesForCountry$ = this.countryDetails$.pipe(
      map(country => country ? country.participations.length : 0)
    );

    // Charger les détails du pays
    this.olympicService.getOlympicById(this.countryId).subscribe((country) => {
      if (country) {
        // Mettre à jour les données du graphique avec les participations
        this.lineChartData.labels = country.participations.map(p => p.year.toString()); // Années
        this.lineChartData.datasets[0].data = country.participations.map(p => p.medalsCount); // Médailles
      }
    });
  }

  // Revient à la page précédente
  goBack(): void {
    this.location.back(); 
  }

  // Désabonnement
  ngOnDestroy(): void {
    this.subscription.unsubscribe(); 
    console.log('CountryDetailsComponent détruit, abonnement nettoyé.');
  }
}
<section class="relative text-white h-screen flex items-center justify-center bg-cover bg-center col-sm-12">
  <button (click)="goBack()" class="bg-blue-500 text-white px-4 py-2 rounded-lg mt-4 hover:bg-blue-700">
    ⬅ Back
  </button>
  <div *ngIf=" countryDetails$ | async as country " class="bg-black bg-opacity-50 p-8 rounded-lg max-w-3xl w-full text-center flex flex-col items-center">
    <h1 class="text-2xl font-bold"> {{country.country}}'s Details</h1>
    <div *ngIf=" numberOfEntriesForCountry$ | async as nbEntries ">
      <p>Number of Entries: {{ nbEntries }}</p>
    </div>
    <div *ngIf=" numberOfAthletes$ | async as nbAthlete ">
      <p>Total number of athletes: {{ nbAthlete }}</p>
    </div>
    <div *ngIf=" numberOfMedals$ | async as nbMedals ">
      <p>Total number of medals: {{ nbMedals }}</p>
    </div>
    <p></p>
  </div>
  <div>
    <span id="myCountryChart"></span>
  </div>
    <div style="width: 600px; height: 400px;">
      <canvas baseChart [data]="lineChartData" [options]="lineChartOptions" chartType="line">
      </canvas>
    </div>

</section>
